import{b as o,c as i,d as n,f as t,g as c,h as d,i as e}from"./_layout-2f49aefd.js";const l={"common.or":"ou","common.and":"e","main.title":"Svelte Intl Precompile","main.subtitle":"A librer\xEDa de i18n para Svelte que analiza e transforma as t\xFAas traducci\xF3ns en tempo de compilaci\xF3n.","playground.title":"Playground","introduction.title":"Introducci\xF3n","introduction.subsection.why-use-it":"\xBFPor qu\xE9 querer\xEDa usala?","introduction.paragraph.why-use-it-1":"Svelte-intl-precompile \xE9 unha librer\xEDa de i18n para apps Svelte que busca proporcionar todas as funcionalidades ca t\xFAa app pode precisar co m\xEDnimo impacto tanto no tama\xF1o da t\xFAa app como na s\xFAa velocidade de execuci\xF3n","introduction.paragraph.why-use-it-2":"Para logralo usa una soluci\xF3n diferente \xE1 maior\xEDa de librer\xEDas de internacionalizaci\xF3n. De forma semellante a como Svelte.js analiza y comprende o teu c\xF3digo e durante a compilaci\xF3n tranf\xF3rmao en javascript compacto e eficiente, esta librer\xEDa inspeciona as t\xFAas traducci\xF3ns escritas na <a href='https://lokalise.com/blog/complete-guide-to-icu-message-format' class='text-primary underline'>ICU message syntax</a> e comp\xEDlaas a funcions pequenas e optimizadas.","introduction.paragraph.why-use-it-3":"Se usas todas e cada unha das funcionalidades soportadas pola sintaxis ICU a\xF1adir\xE1 aproximadamente 2kb a teua app despois do minificado e da compresi\xF3n. Se soamente usas unhas poucas das funcionalidades esa cifra pode baixar asa tan s\xF3 1kb","introduction.paragraph.why-use-it-4":"Dado que non ten que parsear e tokenizar as t\xFAas traducci\xF3ns no navegador, tam\xE9n \xE9 m\xE1is r\xE1pido. Como 4 veces m\xE1is r\xE1pido renderizando traducci\xF3ns a primeira vez, e arredor do 50% m\xE1is r\xE1pido renderizando traducci\xF3ns que xa encontrara antes.","introduction.subsection.playground":"\xBF\xA1Qu\xE9!? Am\xF3same o c\xF3digo","introduction.paragraph.playground-preface":"Aqu\xED tes, pr\xF3bao. Pega as t\xFAas propias traducci\xF3ns e observa o resultado da compilaci\xF3n","introduction.subsection.features":"\xBFQu\xE9 funcionalidades soporta?","introduction.paragraph.features-1":"Todas as funcionalidades da sintaxis ICU est\xE1n soportadas.<br>Ten unha API case completamente compatible con","introduction.paragraph.features-2":", outra librer\xEDa de internacionalizaci\xF3n moi popular e ben dese\xF1ada para Svelte.js ","introduction.paragraph.features-3":"As principais funcionalidades incl\xFAen:","introduction.list-items.features-1":"Traducci\xF3ns con interpolacions, seleccionar ramas de subtraducci\xF3ns en base a valores e o resto de funcionalidades de ICU.","introduction.list-items.features-2":"Formatear datas, tempos, n\xFAmeros, ordinais e divisas, todo apoi\xE1ndose na API Intl presente en t\xF3dolos navegadores modernos e en Node.","introduction.list-items.features-3":"Unha API dese\xF1ada para Svelte.js que poporciona uns convenientes stores que actualizan os seus valores autom\xE1ticamente cando o idioma seleccionado ou as traducci\xF3ns cargadas actual\xEDzanse.","introduction.list-items.features-4":"Unha variedade de funcions pra cargar paquetes de idiomas as\xEDncronamente cando sexa necesario, utilidades para extraer o idioma predeterminado das cabeceras da petici\xF3n HTTP en modo SSR","introduction.list-items.features-5":"Tree-shaking completo de t\xF3dalas utilidades arriba mencionadas que a t\xFAa aplicaci\xF3n non precise","icu-crash-course.title":"ICU syntax: Cursillo acelerado","icu-crash-course.table-heads.definition":"Entrada","icu-crash-course.table-heads.values":"Valores","icu-crash-course.table-heads.output":"Sa\xEDda","icu-crash-course.paragraph.main-1":"Esta librar\xEDa analiza e compila as traducci\xF3ns creadas na syntaxis ICU. Inda que a sintaxis ICU \xE9 un proxecto independiente este \xE9 un cursillo acelerado de porqu\xE9 \xE9 interesante e como usar as s\xFAas principais funcionalidades","icu-crash-course.subsection.why":"\xBFPorqu\xE9 usar a sintaxis ICU?","icu-crash-course.paragraph.why-1":"ICU son as seglas de <em class='italic'>International Components for Unicode</em>. Inda que a s\xFAa popularidade comenzou con C/C++ y Java, \xE9 no ecosistema javascript onde se convertiu no standard de facto para internacionalizaci\xF3n, inda que tam\xE9n \xE9 popular en Python e PHP","icu-crash-course.paragraph.why-2":"Internacionalizar aplicacions \xE9 moito m\xE1is que mapear unha clave \xE1 traducci\xF3n apropiada nun diccionario. Aplicacions internacionalizadas debidamente deben xestional t\xF3dolos aspectos da traducci\xF3n, incluindo a forma en que datas y tempos se formatean, qu\xE9 delimitadores urar nos n\xFAmeros para separar os millares ou os decimais, formateo de divisas y soporter idiomas con x\xE9neros.","icu-crash-course.paragraph.why-3":"Incluso algo tan aparentemente sixelo coma os plurais pode resultar moi complicado nalguns idiomas. O ingl\xE9s, espa\xF1ol e alem\xE1n te\xF1en s\xF3 un singular e un plural pero alg\xFAns idiomas eslavos te\xF1en tres, e outros como o \xE1rabe te\xF1en 6 dependiendo do n\xFAmero de elementos. As veces o n\xFAmero a partir do que se cambia dunha forma do plural \xE1 seguinte var\xEDa dependendo da variante rexional. <br> O ingl\xE9s non ten moitas palabras con dous x\xE9neros pero o franc\xE9s e o castel\xE1n s\xED, e os adxectivos desos sustantivos deben respetar ese x\xE9nero. Formatear <code class='inline'>123456789</code> en ingl\xE9s americano resultar\xE1 en <code class='inline'>123,456,789</code> pero en ingl\xE9s da India ser\xE1 <code class='inline'>12,34,56,789</code>. <br> Formateando divisas o s\xEDmbolo $ vai diante da cantidade pero o \u20AC vai despois.","icu-crash-course.paragraph.why-4":"A sintaxis ICU abstrae toda esta complexidade dos desarrolladores e da os verdadeiros traductores profesionais un meta-lenguage suficientemente expresivo para xestional todas as sutilezas pola s\xFAa conta","icu-crash-course.subsection.interpolations":"Interpolacions","icu-crash-course.paragraph.interpolations-1":`As entradas ICU soportan interpolar valores, que ser\xE1n adecuadamente saneados, polo que pasar <code class='inline'>undefined</code> no ser\xE1 interpolado como <em class='italic'>"undefined"</em>.`,"icu-crash-course.table-cells.interpolations":a=>`Your favorite color is ${o(a)}`,"icu-crash-course.subsection.plurals":"Plurais","icu-crash-course.paragraph.plurals-1":"A segunda funcionalidade m\xE1is usada en cualqueira aplicaci\xF3n \xE9 a pluralizaci\xF3n. A sintaxis ICU proporciona a utilidade <code class='inline'>plural</code> para definir traducci\xF3ns para s plurais dende os m\xE1is sixelos os m\xE1is complexos, todo sen sair da sintaxis en s\xED mesma.","icu-crash-course.paragraph.plurals-2":"Cada posibilidade de pluralizaci\xF3n est\xE1 predecida dun calificador num\xE9rico. As posibles opcions son:","icu-crash-course.paragraph.plurals-3":"Vex\xE1molo cuns exemplos:","icu-crash-course.paragraph.plurals-4":"Alg\xFAns idiomas coma o ingl\xE9s soamente utilizan <code class='inline'>one</code> e <code class='inline'>other</code> pero outros idiomas ser\xE1n capaces de seleccionar sempre o plural m\xE1is adecuando. O l\xEDmite particular que divide <code class='inline'>few</code> e <code class='inline'>many</code> \xE9 altamente cultural.","icu-crash-course.paragraph.plurals-5":"Podes tam\xE9n especificar traducci\xF3ns para cantidades espec\xEDficas usando <code class='inline'>=N</code>. Cando un n\xFAmero espec\xEDfico \xE9 especificado de esta maneira tomar\xE1 precedencia sobre o comportamiento por defecto dos plurais nese idioma. <br> Por exemplo, en ingl\xE9s podes usar <code class='inline'>=2</code> ou <code class='inline'>=12</code> para usar diferentes traducci\xF3ns espec\xEDficamente para un par y una ducia de elementos en lugar de usar o plural xen\xE9rico.","icu-crash-course.paragraph.plurals-6":"Por \xFAltimo, os plurais pueden utilizar a almoadilla para imprimir como n\xFAmero o valor usado para seleccionar o plural e opcionalmente a utilidade pode recibir un offset que ser\xE1 restado do valor antes de reemplazar a almoadilla.","icu-crash-course.list-items.one":"(singular)","icu-crash-course.list-items.two":"(dual)","icu-crash-course.list-items.few":"(paucal)","icu-crash-course.list-items.many":"(Tam\xE9n usado para fraccions)","icu-crash-course.list-items.other":"(plural xen\xE9rico. O usado en idiomas con s\xF3 unha forma de plural)","icu-crash-course.table-cells.plurals-simple":a=>`Your have ${i(a,{o:"one cat",h:`${a} cats`})}`,"icu-crash-course.table-cells.plurals-complex":a=>`Your have ${i(a,{0:"no cats at all",o:"one single cat",2:"a couple cats",3:"a trio of cats",12:"a dozen cats",h:`exactly ${a} cats`})}`,"icu-crash-course.table-cells.plurals-offset":(a,s)=>n(s,1,{0:"Mary does not give a party.",1:`Mary invites ${o(a)} to her party.`,2:`Mary invites ${o(a)} and one other person to her party.`,h:`Mary invites ${o(a)} and ${s-1} other people to her party.`}),"icu-crash-course.subsection.select":"Select","icu-crash-course.paragraph.select-1":"A utilidade <code class='inline'>select</code> \xFAsase para elexir entre varias posibles traducci\xF3ns en base \xF3 valor dun argumento.<br> Inda que ten moitos usos o m\xE1is frecuente \xE9 para ter traducci\xF3ns dependentes do x\xE9nero.","icu-crash-course.table-cells.select":a=>`Your ${t(a,{male:"son",female:"daughter",other:"child"})} has won an award`,"icu-crash-course.table-cells.select-value-male":"Male","icu-crash-course.table-cells.select-value-female":"Female","icu-crash-course.table-cells.select-value-unknown":"Unknown","icu-crash-course.subsection.date":"Datas","icu-crash-course.paragraph.date-1":"Esta utilidade util\xEDzase para formatear datas de acordo as regras do idioma para os formatos por defecto ou os formatos persoalizados que engadiches o inicializar a librer\xEDa.<br> Os formatos disponibles por defecto son:","icu-crash-course.list-items.short":": A representaci\xF3n m\xE1s abreviada (num\xE9rica)","icu-crash-course.list-items.medium":": Representaci\xF3n textual abreviada","icu-crash-course.list-items.long":": Representaci\xF3n textual extendida","icu-crash-course.list-items.full":": A representaci\xF3n m\xE1is completa","icu-crash-course.table-cells.date":a=>`Your next holidays start on ${c(a,"full")}`,"icu-crash-course.subsection.time":"Horas","icu-crash-course.paragraph.time":"Id\xE9ntico \xE1 utilidade para datas pero para foratear \xFAnicamente a parte temporal dun obxeto Date.","icu-crash-course.table-cells.time":a=>`Your doctor's appointment is today at ${d(a,"short")}`,"icu-crash-course.subsection.number":"N\xFAmeros","icu-crash-course.paragraph.number":"Formatea un n\xFAmero de acordo as regras do idioma seleccionado.","icu-crash-course.paragraph.number-2":"Tam\xE9n hay unha funcionalidade avanzada chamada <strong id='crash-course-number-skeletons' class='font-semibold text-primary'>Number Skeletons</strong> que permite personalizar ata o extremo c\xF3mo queres que os n\xFAmeros sexan formateados.","icu-crash-course.paragraph.number-3":"As posibilidades dos number skeleton son ilimitadas.","icu-crash-course.table-cells.number":a=>`Your account balance is ${e(a)}`,"icu-crash-course.table-cells.skeletonCurrency":a=>`Your account balance is ${e(a,{style:"currency",currency:"EUR"})}`,"icu-crash-course.table-cells.skeletonCurrencySigned":a=>`Your account balance is ${e(a,{style:"currency",currency:"EUR",signDisplay:"always"})}`,"icu-crash-course.table-cells.skeletonPercentage":a=>`Game progress ${e(a,{style:"percent"})}`,"icu-crash-course.table-cells.skeletonPercentageTwoDecimals":a=>`Game progress ${e(a,{style:"percent",minimumFractionDigits:2,maximumFractionDigits:2})}`,"icu-crash-course.table-cells.skeletonPercentageScaled":a=>`Game progress ${e(a/100,{style:"percent",minimumFractionDigits:2,maximumFractionDigits:2})}`,"icu-crash-course.table-cells.skeletonMeasurementMeter":a=>`Your destination is ${e(a,{style:"unit",unit:"meter"})} away`,"icu-crash-course.table-cells.skeletonMeasurementMeterLong":a=>`Your destination is ${e(a,{style:"unit",unit:"meter",currencyDisplay:"name",unitDisplay:"long"})} away`,"icu-crash-course.table-cells.skeletonCompactShort":a=>`Are you sure you want to bid ${e(a,{notation:"compact",compactDisplay:"short"})} over asking?`,"icu-crash-course.table-cells.skeletonCompactLong":a=>`Are you sure you want to bid ${e(a,{notation:"compact",compactDisplay:"long"})} over asking?`,"icu-crash-course.table-cells.skeletonScientific":a=>`The chances of winning the lottery are 1 in ${e(a,{notation:"scientific"})}`,"getting-started.title":"Primeiros pasos","getting-started.subsection.installation":"Instalaci\xF3n","getting-started.paragraph.installation-1":"Instala svelte-intl-precompile coma unha dependencia de runtime do teu proxecto Svelte.","getting-started.subsection.create-translations":"Crea as t\xFAas traducci\xF3ns","getting-started.paragraph.create-translations-1":(a,s,r)=>`A continuaci\xF3n crea o directorio onde por os teus ficheiros de traducci\xF3ns. A min gustame usar ${o(a)} ${o(r)} ${o(s)}`,"getting-started.paragraph.create-translations-2":"no raiz do proxecto, pero en realidade podes colocar o directorio onde prefiras","getting-started.paragraph.create-translations-3":"Recomiendo usar ficheiros .json pero podes tam\xE9n crear ficheiros javascript que exporten un \xFAnico obxeto que cont\xE9n as traducci\xF3ns. Calqueira que sexa a t\xFAa preferencia, as traducci\xF3ns son simples cadeas coa sintaxis ICU:","getting-started.paragraph.create-translations-4":"Eu prefiero o diccionario de traducci\xF3ns te\xF1a un \xFAnico nivel e usar puntos para crear xerarqu\xEDas coma o de enriba, pero tam\xE9n podes ani\xF1ar obxetos coma a continuaci\xF3n:","getting-started.paragraph.create-translations-5":"\xA1JSON \xE9 demasido r\xEDxido! \xA1Quero m\xE1is flexibilidade!","getting-started.paragraph.create-translations-6":"Podes usar funcionalidades de JSON 5 nos teus ficheiros json. Por exemplo, podes usar comentarios, strings multi-l\xEDnea, comillas simples, comas \xF3 final de l\xEDnas... <br>Funciona autom\xE1ticamente.","getting-started.paragraph.create-translations-7":"Non me gustan as chaves","getting-started.paragraph.create-translations-8":"Como vexas. Si che gusta usar espacios puedes tam\xEDn utilizar ficheiros YAML. Tan so engade a extensi\xF3n .yaml ou .yml. Se e que che van esas cousas.","getting-started.paragraph.create-translations-9":"Quero m\xE1is funcionalidades","getting-started.paragraph.create-translations-10":"Podes definir as t\xFAas traduccions en ficheiros .js, ficheiros .ts y ficheiros .mjs. O m\xF3dulo debe exportar un objecto coas traducci\xF3ns como o seu export por defecto.","getting-started.subsection.hook-into-sveltekit":"Acomplar o compilador a SvelteKit","getting-started.paragraph.hook-into-sveltekit-1":a=>`O compilador desta librer\xEDa necesita integrarse no proceso de complilado de SvelteKit do teu proxecto. Para elo engadep a lista de plugins de vite no teu <code class="bg-code px-2">${o(a)}</code>`,"getting-started.paragraph.hook-into-sveltekit-2":"E xa est\xE1 todo listo. Tempo de usar a librer\xEDa.","getting-started.subsection.hook-into-vite":"Acoplar o compilador a Vite.js","getting-started.paragraph.hook-into-vite-1":a=>`Se non est\xE1s a usar SvelteKit senon simplemente Vite.js a configuraci\xF3n \xE9 moy semellante. O fin e o cabo SvelteKit usa Vite.js internamente. Importa o compilador e eng\xE1deo \xE1 lista de plugins en <code class="bg-code px-2">${o(a)}</code>`,"configuration.title":"Configuraci\xF3n","configuration.subsection.example":"Exemplo de configuraci\xF3n","configuration.link.example":"Exemplo","configuration.paragraph.example-1":`Este \xE9 o exemplo de traballo m\xEDnimo da inicializaci\xF3n da biblioteca. 
Pon isto no teu`,"configuration.paragraph.example-2":".","configuration.paragraph.example-3":"Esto es suficiente para ir comenzando pero vamos a profundizar m\xE1is en todas as opcions que tes.","configuration.subsection.static-locales":"Engadir idiomas est\xE1ticamente","configuration.paragraph.static-locales-1":"Coma no exemplo anterior, a forma m\xE1is sixela de angadir entradas \xF3 diccionario \xE9 simplemente importar o m\xF3dulo que cont\xE9n as traducci\xF3ns e angadilas usando","configuration.paragraph.static-locales-2":"Observa que a pesar de que definiches as t\xFAas traducci\xF3ns nun ficheiro JSON aqu\xED as estamos importando como se fosen m\xF3dulos ES6 situados en ","configuration.paragraph.static-locales-3":". Esto es porque la librer\xEDa ha transformado las traducci\xF3ns en un m\xF3dulo con funciones durante la compilaci\xF3n.","configuration.paragraph.static-locales-4":"Esta estratexia est\xE1 cargando todos esos idiomas incluso se soamente un vai acabar mostrado. Esto non soe ser un problema cando est\xE1s a comenzando o desenvolvemento dun novo proxecto ou se o teu proyecto ten poucas traducci\xF3ns ou poucos idiomas, pero cando a t\xFAa aplicaci\xF3n comenza a crecer deber\xEDa empezar a cargar os paquetes de traducci\xF3ns baixo demanda.","configuration.subsection.dynamic-locales":"Engadir idiomas din\xE1micamente","configuration.paragraph.dynamic-locales-1":"Unha vez tes unha cantidad significativa de traducci\xF3ns en varios idiomas ser\xEDa moi ineficiente cargar todos eles para cada usuario cando s\xF3 vai utilizar o que haxa seleccionado. A librer\xEDa ten una funci\xF3n","configuration.paragraph.dynamic-locales-2":"para din\xE1micamente importar idiomas cando o usuario o seleccione e outra funci\xF3n","configuration.paragraph.dynamic-locales-3":"para esperar a que a carga estea finalizada.","configuration.paragraph.dynamic-locales-4":"Se todos os teus idiomas cargan din\xE1micamente debes impedir que a app prosiga o renderizado ata que o paquete do idioma inicial estea cargado. Retornando ol resultado de invocala dende a funci\xF3n","configuration.paragraph.dynamic-locales-5":"proporcionada por SvelteKit far\xE1 exactamente iso.","configuration.subsection.dynamic-locales-shorthand":"Engadir idiomas din\xE1micamente (pero m\xE1is r\xE1pido esta vez)","configuration.paragraph.dynamic-locales-shorthand-1":"Se tan s\xF3 queres rexistar t\xF3dolos idiomas dispo\xF1ibles (\xE9 dicir, todos aquelos para os que tes un ficheiro JSON con traducci\xF3ns) autom\xE1ticamente, hay un atallo moi pr\xE1ctico para facelo. A carpeta","configuration.paragraph.dynamic-locales-shorthand-2":"de onde importas as traducci\xF3ns funciona tam\xE9n coma un m\xF3dulo de onde podes importar d\xFAas utilidades: ","configuration.paragraph.dynamic-locales-shorthand-3":"A primera \xE9 unha funci\xF3n que cando se invoca equivale a chamar","configuration.paragraph.dynamic-locales-shorthand-4":"para cada un dos idiomas.<br> A segunda \xE9 un array cos c\xF3digos ISO dos idiomas dipo\xF1ibles (tanto se os rexistraches coma se inda non), para que te\xF1as esa informaci\xF3n dispo\xF1ible se a necesitas utilizar.","configuration.subsection.init":"Idiomas inicial e de rescate","configuration.paragraph.init-1":"\xC1 invocaci\xF3n","configuration.paragraph.init-2":"as opcions m\xE1is importantes son","configuration.paragraph.init-3":". A primeira determina o idioma no que a app vai ser renderizada inicialmente y o segundo o idioma que se usar\xE1 como derradeida opci\xF3n cando unha entrada non se atope no diccionario do idioma actual.","configuration.paragraph.init-4":"Hay moitas cousas que se poden facer para lograr a experiencia de usuario perfecta, como convenientemente inicializar","configuration.paragraph.init-5":"\xF3 idioma seleccionado polo usuario durante o rexistro se fixo login, obtindo das cookies si xa visitara a p\xE1gina anteriormente ou obtelo da cabeceira <pre class='inline'>Accept-Language</pre> da petici\xF3n HTTP cando se renderiza no servidor, pero a m\xE1is sixela \xE9 detectar o idioma do navegador ou da URL coas utilidades proporcionadas para elo.","configuration.subsection.find-locale":"Atopar o mellos idioma","configuration.paragraph.find-locale-1":"Hai m\xFAltiples estratexias v\xE1lidas para seleccionar o mellor idioma que pasar \xE1 funci\xF3n","configuration.paragraph.find-locale-2":". Esta librer\xEDa proporciona utilidades para as estratexias m\xE1is comuns:","configuration.definitions.navigator":"Extrae o idioma do navegador, que a s\xFAa vez \xE9 o idioma do sistema operativo.","configuration.definitions.query":"Extrae o idioma no par\xE1metro dado a query string da URL.<br>P.e <pre class='inline'>getLocaleFromQueryString('lang')</pre> para <pre class='inline'>/users?sort=name&amp;dir=asc&amp;lang=es</pre>","configuration.definitions.hash":"Como <pre class='inline'>getLocaleFromQueryString</pre> pero para el hash de la URL.<br>P.e <pre class='inline'>getLocaleFromHash('lang')</pre> para <pre class='inline'>/users#sort=name&amp;dir=asc&amp;lang=es</pre>","configuration.definitions.path":"Extrae o idioma dos segmentos da URL.<br>P.e <pre class='inline'>getLocaleFromPathname(/^/((es|en)(-\\w\\w)?)/)</pre> para <pre class='inline'>myapp.com/en-US/users</pre>","configuration.definitions.host":"Extrae o idioma del host.<br>P.e <pre class='inline'>getLocaleFromHostname(/^((es|en)(-\\w\\w)?)\\./)</pre> para <pre class='inline'>https://pt.myapp.com</pre>","configuration.subsection.custom-formats":"Formatos persoalizados","configuration.paragraph.custom-formats-1":"Esta librer\xEDa pode formatear n\xFAmeros, datas e horas. Faino sen incrementar significativamente o tama\xF1o do teu proxecto porque utiliza a API Intl xa presente en todos os navegadores modernos e main en Node.js.<br/>Por defecto a t\xFAa app disp\xF3n de estos formatos pero podes engadir os teus propios.","configuration.paragraph.custom-formats-2":"Se queres definir os teus propios formatos p\xE1saos \xF3 incializar a librer\xEDa usando a opci\xF3n","configuration.paragraph.custom-formats-3":", os cuales ser\xE1n engadidos \xF3s formatos por defecto listados arriba. Os formatos deben ser obxetos v\xE1lidos para pasar a","usage.title":"Uso","usage.paragraph.preface-1":"A API de esta librer\xEDa foi tomada en gran parte da excelente","usage.paragraph.preface-2":", hasta o punto de que na maior\xEDa de proxectos podes cambiar de svelte-i18 a svelte-intl-precompile e vice versa sen modificar a t\xFAa aplicaci\xF3n m\xE1is que actualizado o nome do paquete dende o que importas as funcions.","usage.paragraph.preface-3":'Su API basada en "stores" es especialmente pr\xE1ctica de utilizar en las plantillas y provee el beneficio a\xF1adido de hacer toda tu aplicaci\xF3n ractiva, autom\xE1ticamente actualizando cada traducci\xF3n si el usuario cambia de idioma o se cargan nuevas traducci\xF3ns. Para los siguientes ejemplos vamos a asumir que est\xE1 trabajando en una aplicaci\xF3n que contiene las siguientes traducci\xF3ns.',"usage.link.basic-translations":"Traducci\xF3ns b\xE1sicas","usage.subsection.basic-translations":"Traducci\xF3ns b\xE1sicas: O store <pre class='inline'>$t(key, ops)</pre>.","usage.paragraph.basic-translations-1":"Este store \xE9 o que utilizar\xE1s m\xE1is a miudo. Simplemente imp\xF3rtao e usa a funci\xF3n que cont\xE9n, pas\xE1ndolle o nome da traducci\xF3n a usar.","usage.subsection.passing-arguments":"Pasar argumentos","usage.paragraph.passing-arguments-1":"O segundo argumento recibido por","usage.paragraph.passing-arguments-2":"\xE9 un obxecto. Calquer argumento requerido dentro da traducci\xF3n proporci\xF3nase coa opci\xF3n","usage.paragraph.passing-arguments-3":".","usage.paragraph.passing-arguments-4":"Non hai ningunha diferencia pasando argumentos dependendo de se van a interpolar ou usarse para computar plurais ou sub-ramas, ou son n\xFAmeros ou datas para ser formateados. Todos os argumentos p\xE1sanse da mesma maneira.","usage.subsection.formatting":"Formatear datas, horas y n\xFAmeros","usage.paragraph.formatting-1":"Inda que podes pasar n\xFAmeros, datas e horas as t\xFAas traducci\xF3ns que ser\xE1n formateadas segindo o que a mesaxe ICU indique, a librer\xEDa tambien ten outros stores para cando necesitas formatear directamente dende o teu c\xF3digo.","usage.subsection.other-stores":"Outros stores","usage.paragraph.other-stores-1":"Hai tres stores m\xE1is que paga a pena mencionar:","usage.paragraph.other-stores-2":"Imos crear un compo\xF1ente para seleccionar o idioma actual","usage.paragraph.other-stores-3":"O c\xF3digo de arriba \xE9 bastante sinxelo. Tan s\xF3 iteramos a lista de idiomas dispo\xF1ibles en <code class='bg-code px-2'>$locales</code> e renderizamos un bot\xF3n por cada in. Facendo click nesos botons asignar\xE1 o seu dioma o store <code class='bg-code px-2'>$locale</code>.<br/> Todas as traducci\xF3ns da app sactualizaranse sen necesidade de recargar a p\xE1gina.","usage.definitions.other-stores-1":`Pode ser usado para leer ou asignar o idioma actual. (P.e: <pre class='inline'>"es-ES"</pre>).`,"usage.definitions.other-stores-2":`Cont\xE9n a lista de idiomas rexistrados. (P.e: <pre class='inline'>["es-ES", "en", "pt-BR"]</pre>).`,"usage.definitions.other-stores-3":"Cont\xE9n <pre class='inline'>true</pre> cando un idioma as\xEDncrono todav\xEDa est\xE1 cargando."};export{l as default};
